import React, {
    Component
} from 'react'
import data from '../exa'
export default class CovredPro extends Component {
    render() {
        return ( 
            <section className = "container" >
            <h1 > Projects that are about to be covered: </h1> {
                data.cardData.map((item, index) => {
                    return (

                        <hr />
                    )
                })
            } 
            </section>
        )
    }
}
